            <h3 class="para_title">Why we ask for the above data?</h3>
            <p class="para">
                At our website, we understand the importance of data privacy and security. We ask for the above personal
                data during the registration process to ensure that we provide you with the best possible experience
                while using our website. Here are some of the reasons we ask for this information:<br />
            </p>
            <ol type="1" class="para">
                <li>Identification: We ask for your name and email address to identify you as a unique user on our
                    website. This allows us to provide you with personalized services and offers.</li>
                <li>Communication: We ask for your email address and phone number to communicate with you about our
                    products, services, and promotions. This also enables us to send you important updates and
                    notifications related to your account.</li>
                <li>Personalization: We ask for your date of birth and gender to personalize your experience on our
                    website. This allows us to provide you with more relevant content and recommendations based on your
                    preferences.</li>
                <li>Security: We ask for your password to ensure the security of your account. This protects your
                    personal information from unauthorized access and ensures that only you can access your account.
                </li>
            </ol>
            <p class="para">
                Rest assured that we take data privacy and security very seriously, and we will never share your
                personal information with any third party without your explicit consent. Your trust is important to us,
                and we are committed to maintaining the highest standards of data privacy and security.
            </p>
